import { useState } from "react";

function SuspenseChild() {
    const [data, setData] = useState(null);

    const handleFetch = () => {
        fetch('/api')
            .then(data => setData(data))
            .catch((error) => {
                console.log(error);
            });
        suspense;
    };

    return (
        <div>
            <h3>Suspense Child</h3>
            <button onClick={handleFetch}>Fetch</button>
            {data}
        </div>
    );
}

export default SuspenseChild;
